        console.log(Router.query.id);
    }

    go() {
        Router.push('/home');
    }

    render() {
        return (
            <div>Hello.
                <button onClick={this.go.bind(null)}>HOME</button>
            </div>

        )

    }



}
export default TalkRoom;
